import React, { useState, useEffect } from 'react'
import './App.css';

function App() {
  const [stickerArray, setStickerArray] = useState([]);
  const stickerNUM = 10;

  function notice(props) {
    alert(props);
  };

  useEffect(() => {
    let newStickerArray = [...stickerArray];
    for (let i = 0; i < stickerNUM; i++) {
      newStickerArray.push(React.Children.toArray(<button key={i} className={`item_${i}`} onClick={() => { notice(i) }}>{i}</button>));
    };
    setStickerArray(newStickerArray);
  }, [])


  return (
    <React.Fragment>
      {stickerArray}
    </React.Fragment>
  );
}

export default App;
